import React from 'react';
import logo from './logo.svg';
import { VictoryChart, VictoryVoronoiContainer, VictoryGroup, VictoryTooltip, VictoryLine, VictoryScatter, VictoryAxis, VictoryTheme } from 'victory';
import './App.css';

const data = [
  { x: 1, y: -3 },
  { x: 2, y: 5 },
  { x: 3, y: 3 },
  { x: 4, y: 0 },
  { x: 5, y: -2 },
  { x: 6, y: -2 },
  { x: 7, y: 5 }
];

class App extends React.Component {
  render() {
    return (
      <VictoryChart height={400} width={400} containerComponent={<VictoryVoronoiContainer/>}>
        <VictoryAxis crossAxis
          width={400}
          height={400}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetY={200}
          standalone={false}
          style={{

            grid: {stroke: ({ tick }) => tick > 0.5 ? "red" : "grey"},
            ticks: {stroke: "grey", size: 5},
            tickLabels: {fontSize: 15, padding: 5}
          }}
        />
        <VictoryAxis dependentAxis crossAxis
          width={400}
          height={400}
          domain={[-20, 20]}
          theme={VictoryTheme.material}
          offsetX={200}
          standalone={false}
        />
        <VictoryGroup
          color="#c43a31"
          labels={({ datum }) => `x: ${datum.x} y: ${datum.y}`}
          labelComponent={
            <VictoryTooltip style={{ fontSize: 5 }}/>
          }
          data={data}
        >
        <VictoryLine/>

        <VictoryScatter
          size={({ active }) => active ? 4 : 1}
        />
        </VictoryGroup>
      </VictoryChart>
    );
  }
}

export default App;


